           show:false
       }

   }
   componentDidMount(){

    console.log("componentDidMount call");
   }
   clickfun=()=>{
   this.setState({
       show:!this.state.show
   })
   }
    render() {
        console.log("render  call");
        return (
            <div>
               {this.state.show?<Child/>:<Coloumnfilter/>} 
                <button onClick={this.clickfun}>click</button>
                
            </div>
        )
    }
}

